review:
[h1]재미가 없어서 그런지 접속자가 거의 없는 게임이다.;;[/h1]

일종의 총싸움 FPS게임으로 보는게 맞을거같다.
맵상에서 총을 들고 상대방을 죽이면서 반도체 칩 같은걸 먹으러 돌아다니는 게임인데,
돌아다니다보면 총은 몇가지 제공해준다.
하지만 게임의 재미를 주는 요소가 없고 단조롭고 식상한 게임이다.
게다가 재미가 없어서인지 접속자 또한 거의 없는 게임이다.

본인이 했을때는 본인 포함해서 딱 3명...;;;
이런 멀티플레이게임은 접속자가 많아야 재미가 있는데
게임성이 안받쳐주니까 유저들의 외면을 받다보니 접속자는 없고,
게임에 접속하면 썰렁하다;;;
너무나도 게임성이 없는 게임이다.;;;
별로 추천해주고 싶지 않은 게임이다.



평점 30점 이하..;;;;
